import {Chart, registerables} from 'chart.js';
import {Doughnut} from "vue-chartjs"

Chart.register(...registerables);

export default{
    extends: Doughnut,
    props: ["chartData", "options"],
    mounted() {
        this.renderChart(this.chartData, this.options);
    },
};
